import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super();
    this.state = {
      kediler: [],
    };
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.kediler}</h1>
      </div>
    );
  }

  componentDidMount() {
    fetch("http://localhost:8000/kedi")
      .then((response) => console.log(response))
      .then((users) => this.setState({ kediler: users }));
  }
}

export default App;
